    sunrise: 1661834187,
    sunset: 1661882248,
  },
  timezone: 7200,
  id: 3163858,
  name: "Zocca",
  cod: 200,
};

export async function getCurrentWeather(payload: GetCurrentWeatherPayload) {
  const apiUrl = `baseURL/`;
  return instance.get(apiUrl, { params: payload });
}
